import React, { useState, useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './components/Navbar';

function Main() {
  const [fullnames, setFullNames] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/data')
      .then((res) => res.json())
      .then((data) => setFullNames(data))
      .catch((error) => console.log(`Your error: ${error}`));
  }, []);

  const filteredNames = fullnames.filter((item) => {
    // Check if fullnames is not an empty string
    if (fullnames === '') {
      return true; // Return true to include all names
    }
    return item.lastname.toLowerCase() === fullnames.toLowerCase();
  });

  return (
    <div>
      <header>
        <Navbar />
      </header>
      <Outlet context={{ filteredNames, setFullNames }} />
    </div>
  );
}

export default Main;
